CREATE TABLE PlayerStats(
   Rk     INTEGER  NOT NULL
  ,Player VARCHAR(24) NOT NULL
  ,Class  VARCHAR(2) NOT NULL
  ,Pos    VARCHAR(1) NOT NULL
  ,School VARCHAR(20) NOT NULL
  ,G      INTEGER  NOT NULL
  ,MP     INTEGER  NOT NULL
  ,TRB    INTEGER  NOT NULL
  ,AST    INTEGER  NOT NULL
  ,STL    INTEGER  NOT NULL
  ,BLK    INTEGER  NOT NULL
  ,TOV    INTEGER  NOT NULL
  ,PF     INTEGER  NOT NULL
  ,PTS    INTEGER  NOT NULL
  ,FG     NUMERIC(5,3)
  ,2P     NUMERIC(5,3)
  ,3P     NUMERIC(5,3)
  ,FT     NUMERIC(5,3)
  ,PTS_PG NUMERIC(4,1) NOT NULL
  ,TRB_PG NUMERIC(4,1) NOT NULL
  ,AST_PG NUMERIC(3,1) NOT NULL
  ,STL_PG NUMERIC(3,1) NOT NULL
  ,BLK_PG NUMERIC(3,1) NOT NULL
  ,PER    NUMERIC(5,1)
  ,WS     NUMERIC(4,1) NOT NULL
  ,BPM    NUMERIC(5,1) NOT NULL
  ,PRIMARY KEY(Player,School)
);
